import React, { Component }  from 'react';
import { PageHeader, Affix, Button, Card } from 'antd';
import './index.less';

class HomePage extends Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }

  render() {
    const { isLogin } = this.state;

    return (   
      <div className="home-page">
        <PageHeader
          className="home-page-header"
          backIcon={false}
          title="FA监控平台"
          subTitle="Flight Aware Monitoring Platform"
        />
        <Affix style={{width: '75%'}} offsetTop={30}>
          <div className="home-page-affix">
            <Button style={{marginTop: 10}} type="primary">
              快速开始
            </Button>
            <Button style={{marginTop: 10}} type="primary">
              新建项目
            </Button>
            <Button style={{marginTop: 10}} type="primary">
              我的项目
            </Button>
            {
              !isLogin && <Button style={{marginTop: 10}} type="primary">
                用户登陆
              </Button>
            }
            {
              !isLogin && <Button style={{marginTop: 10}} type="primary">
              注册账号
            </Button>
            }
            <Button style={{marginTop: 10}} type="primary">
              内测调试
            </Button>
          </div>
        </Affix>
        <Card
          hoverable
          style={{ width: '75%', marginTop: 20, height: 5000 }}
        >
        </Card>
        <Card
          hoverable
          style={{ width: '75%', marginTop: 20 }}
        >
        </Card>
      </div>
    );
  }
}

export default HomePage;
